import React, { useEffect, useState, useCallback } from "react";
import io from "socket.io-client";
import "./App.css";

const socket = io("http://localhost:5000");

export default function App() {
  const [frame, setFrame] = useState(null);
  const [counts, setCounts] = useState({});
  // X√≥a crossCounts: const [crossCounts, setCrossCounts] = useState({ up: 0, down: 0 }); 
  const [updatedKeys, setUpdatedKeys] = useState([]);
  const [confThreshold, setConfThreshold] = useState(0.3); 
  const [isIntrusionAlert, setIsIntrusionAlert] = useState(false); // C·∫£nh b√°o ROI
  const [plates, setPlates] = useState({}); // Bi·ªÉn s·ªë xe

  // G·ª≠i ng∆∞·ª°ng tin c·∫≠y l√™n server
  const sendThresholdUpdate = useCallback((newThreshold) => {
    socket.emit("update_conf_threshold", { threshold: newThreshold });
  }, []);

  const handleThresholdChange = (event) => {
    const newThreshold = parseFloat(event.target.value);
    setConfThreshold(newThreshold);
    sendThresholdUpdate(newThreshold);
  };

  useEffect(() => {
    socket.on("frame", (data) => {
      setFrame("data:image/jpeg;base64," + data.frame);

      // C·∫≠p nh·∫≠t Counts
      const changedKeys = Object.keys(data.counts).filter(
        (key) => counts[key] !== data.counts[key]
      );
      setUpdatedKeys(changedKeys);
      setCounts(data.counts);

      // C·∫≠p nh·∫≠t c√°c gi√° tr·ªã kh√°c
      // X√≥a logic cross_counts: if (data.cross_counts) setCrossCounts(data.cross_counts);
      if (data.intrusion !== undefined) setIsIntrusionAlert(data.intrusion);
      if (data.plates) setPlates(data.plates);

      setTimeout(() => setUpdatedKeys([]), 800);
    });

    sendThresholdUpdate(confThreshold);

    return () => {
      socket.off('frame');
    };
  }, [counts, confThreshold, sendThresholdUpdate, plates]); 

  return (
    <div className="app-container">
      <div className={isIntrusionAlert ? "alert-active" : ""}>
        <h1>üöó Vehicle & Pedestrian Tracker</h1>
      </div>

      <div className="content">
        <div className="stream-container">
          {frame ? (
            <img src={frame} alt="stream" className={isIntrusionAlert ? "stream-alert-border" : ""} />
          ) : (
            <p className="waiting-text">Waiting for stream...</p>
          )}
        </div>

        <div className="counts-container">
          
          {/* INTRUSION ALERT */}
          {isIntrusionAlert && (
            <div className="intrusion-banner">
              üö® INTRUSION ALERT! (X√ÇM NH·∫¨P V√ôNG C·∫§M!) üö®
            </div>
          )}
            
          {/* CONTROL PANEL */}
          <div className="control-panel">
            <h2>‚öôÔ∏è Control Panel</h2>
            <label>Confidence Threshold: **{confThreshold.toFixed(2)}**</label>
            <input
              type="range"
              min="0.05"
              max="0.95"
              step="0.05"
              value={confThreshold}
              onChange={handleThresholdChange}
              className="threshold-slider"
            />
          </div>
            
          <hr />
            
          {/* RECOGNIZED PLATES */}
          <h2>üè∑Ô∏è Recognized Plates</h2>
          {Object.keys(plates).length > 0 ? (
            <ul className="plate-list">
              {Object.entries(plates).map(([id, plate]) => (
                // ƒê·∫£m b·∫£o lo·∫°i b·ªè ti·ªÅn t·ªë "LP_" khi hi·ªÉn th·ªã ID
                <li key={id}>
                  **ID {id.replace('LP_', '')}:** <span className="plate-text">{plate}</span>
                </li>
              ))}
            </ul>
          ) : (
            <p>No license plates detected.</p>
          )}

          <hr /> 
            
          {/* TOTAL OBJECTS */}
          <h2>üìä Total Objects</h2>
          <ul>
            {Object.entries(counts).map(([k, v]) => (
              <li
                key={k}
                className={updatedKeys.includes(k) ? "count-updated" : ""}
              >
                {k}: <span>{v}</span>
              </li>
            ))}
          </ul>
            
          {/* X√ìA: DIRECTIONAL COUNTS (ƒê√£ x√≥a kh·ªèi giao di·ªán) */}
        </div>
      </div>
    </div>
  );
}
